// SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;
interface IMenuManagement {
    function getMenuItem(uint _itemId) external view returns (uint, string memory, uint, bool);
}
interface IPromotionsAndDiscounts {
    function getDiscount(uint _discountId) external view returns (uint, string memory, uint, uint, bool);
}
interface IFastCoin {
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function approve(address spender, uint256 value) external returns (bool);
}
import "./FastCoin.sol";

contract OrderProcessing {
    struct Order {
        uint id;
        address customer;
        uint[] itemIds;
        uint[] quantities;
        uint totalPrice;
        bool isCompleted;
    }

    mapping(uint => Order) public orders;
    uint public nextOrderId;
    address public manager;
    IMenuManagement menuManagement;
    IPromotionsAndDiscounts promotionsAndDiscounts;
    IFastCoin public fastCoin;
    FastCoin public fastcoinContract;

    address public cafeteriaWallet = 0xF0d1611c0C7FbB61F72f5fBEc835A71E59C5edbF; 

    event OrderPlaced(uint orderId, address customer, uint[] itemIds, uint[] quantities, uint totalPrice);
    event OrderCompleted(uint orderId);

    constructor(address _menuManagementAddress,address _fastCoinAddress, address _cafeteriaWallet,address _fastcoinContract) {
        manager = msg.sender;
        menuManagement = IMenuManagement(_menuManagementAddress);
        fastCoin = IFastCoin(_fastCoinAddress);
        cafeteriaWallet = _cafeteriaWallet;
        fastcoinContract = FastCoin(_fastcoinContract);
    }

    modifier onlyManager() {
        require(msg.sender == manager, "Only manager can call this");
        _;
    }

    function setPromotionsAndDiscountsAddress(address _address) public onlyManager {
        promotionsAndDiscounts = IPromotionsAndDiscounts(_address);
    }

    function placeOrder(uint[] memory _itemIds, uint[] memory _quantities, uint _discountId) public {
        require(_itemIds.length == _quantities.length, "Item IDs and quantities length mismatch");
        uint totalPrice = 0;
        for (uint i = 0; i < _itemIds.length; i++) {
            (, , uint price, bool isAvailable) = menuManagement.getMenuItem(_itemIds[i]);
            require(isAvailable, "Item not available");
            totalPrice += price * _quantities[i];
        }
       // Apply discount if available
        // if (_discountId != 0) {
        //     (, , uint discountPercent, uint validUntil, bool isActive) = promotionsAndDiscounts.getDiscount(_discountId);
        //     if (isActive && block.timestamp <= validUntil) {
        //         uint discountAmount = totalPrice * discountPercent / 100;
        //         totalPrice -= discountAmount; // Apply the discount
        //     }
        // }
     //   require(fastcoinContract.approve(address(this), totalPrice), "Approval failed");
     //   require(fastcoinContract.approve(msg.sender, totalPrice), "Approval failed");

        // Pay for the order
       // fastcoinContract.payForOrder(totalPrice);
        //require(fastCoin.transferFrom(msg.sender, address(this), totalPrice), "Payment failed");
        // orders[nextOrderId] = Order(nextOrderId, msg.sender, _itemIds, _quantities, totalPrice, false);
        // emit OrderPlaced(nextOrderId, msg.sender, _itemIds, _quantities, totalPrice);
        // nextOrderId++;
    }

  

    function completeOrder(uint _orderId) public onlyManager {
        require(_orderId < nextOrderId, "Order does not exist");
        require(!orders[_orderId].isCompleted, "Order is already completed");
        orders[_orderId].isCompleted = true;
        emit OrderCompleted(_orderId);
    }

    function getOrder(uint _orderId) public view returns (Order memory) {
        require(_orderId < nextOrderId, "Order does not exist");
        return orders[_orderId];
    }
}
